import React, { Component } from 'react'
import { Link } from 'react-router-dom';
import Four from '../images/Four.png';

export default class FourOhFour extends Component {
  render() {
    return (
      <div className='Four'>
        <img src={Four}  />
            <p style={{textAlign:"center"}}>
              <Link to="/">Go to Home </Link>
            </p>
      </div>
    )
  }
}
